sentences.explanationText:
記得（gei3 dak1）=remember;
帶（daai3）=take/bring;
遮（ze1）=umbrella
啊（aa3）:A Cantonese sentence-final particle used to add a tone of "urging" or "reminding".

最近（zeoi3 gan6）=recently;
捉棋（zuk1 kei2）=play chess;
赢(jeng4)=win;
輸（syu1）=lose；
多（do1）=more (times);→赢多（jeng4 do1）=win more often；输多（syu1 do1）=lose more often.
啊？（aa3）:A Cantonese sentence-final particle used in questions to add a tone of "inquiring" or "confirming".
